import { useContext, Redirect } from "react";
import { Outlet, Navigate, useLocation, useOutlet } from "react-router-dom";
import UserContext from "../contexts/UserContext";
import Landing from "../components/Landing";

const ProtectedRoutes = () => {
  const { isLoading, isAuthenticated, log } = useContext(UserContext);
  const location = useLocation();
  console.log("hello website", isLoading);
  if (isLoading) {
    return null;
  }
  console.log("Protection Page", isAuthenticated);
  if (!isAuthenticated) {
    return <Navigate to="/" replace state={{ from: location }} />;
  }
  return <Outlet />;
};

export default ProtectedRoutes;
